script: |
  super -f text -I q8884.spq | sort > q8884.out

inputs:
  - name: q8884.spq
    data: |
      SELECT + + col1 AS col1 FROM tab0 (FORMAT parquet) WHERE - 94 + + - ( col0 ) NOT BETWEEN col1 AND - - 8 * + - col2;
  - name: tab0

outputs:
  - name: q8884.out
    data: |
      1
      21
      81
